const majorityElement = (arr) => {
  const len = arr.length;

  let count = 0;
  let element = arr[0];
  let currentCount = 0;
  for (let i = 0; i < len; i++) {

    if (arr[i] !== arr[i + 1]) {
      currentCount = arr.filter(item => item === arr[i]).length
    }


    if (count < currentCount) {
      count = currentCount;

      if (currentCount > len / 2)
        element = arr[i];
    }
  }

  return element;
}


